import FlashCard from "./FlashCard";

const FlashDeals = ({prod}) => {
    return ( 
        <>
            <section className="flash background">
                <div className="container f_flex">
                    <div>
                    <i className="fa fa-bolt"></i>
                    <h1>Flash Deals</h1>
                    </div>
                   <FlashCard/>
                </div>
            </section>
        </>
     );
}
 
export default FlashDeals;
